func (u *__Like_Selector) _stoSql() (string, []interface{}) {
	sqlWherrs, whereArgs := whereClusesToSql(u.wheres, u.whereSep)

	sqlstr := "SELECT " + u.selectCol + " FROM sun.likes"

	if len(strings.Trim(sqlWherrs, " ")) > 0 { //2 for safty
		sqlstr += " WHERE " + sqlWherrs
	}

	if u.orderBy != "" {
		sqlstr += u.orderBy
	}

	if u.limit != 0 {
		sqlstr += " LIMIT " + strconv.Itoa(u.limit)
	}

	if u.offset != 0 {
		sqlstr += " OFFSET " + strconv.Itoa(u.offset)
	}
	return sqlstr, whereArgs
}

func (u *__Like_Selector) GetRow(db *sqlx.DB) (*Like, error) {
	var err error

	sqlstr, whereArgs := u._stoSql()

	if LogTableSqlReq.Like {
		XOLog(sqlstr, whereArgs)
	}

	row := &Like{}
	//by Sqlx
	err = db.Get(row, sqlstr, whereArgs...)
	if err != nil {
		if LogTableSqlReq.Like {
			XOLogErr(err)
		}
		return nil, err
	}

	row._exists = true

	OnLike_LoadOne(row)

	return row, nil
}

func (u *__Like_Selector) GetRows(db *sqlx.DB) ([]*Like, error) {
	var err error

	sqlstr, whereArgs := u._stoSql()

	if LogTableSqlReq.Like {
		XOLog(sqlstr, whereArgs)
	}

	var rows []*Like
	//by Sqlx
	err = db.Unsafe().Select(&rows, sqlstr, whereArgs...)
	if err != nil {
		if LogTableSqlReq.Like {
			XOLogErr(err)
		}
		return nil, err
	}

	/*for i:=0;i< len(rows);i++ {
		rows[i]._exists = true
	}*/

	for i := 0; i < len(rows); i++ {
		rows[i]._exists = true
	}

	OnLike_LoadMany(rows)

	return rows, nil
}

